import React from 'react';
import { CountdownCircleTimer } from 'react-countdown-circle-timer';

const App = () => (
  <CountdownCircleTimer
    onComplete={() => {
      // do your stuff here
      return [true, 1500]; // repeat animation in 1.5 seconds
    }}
    isPlaying
    duration={10}
    colors={[['#A30000']]}
  />
);

export default App;
